import {  NavLink } from "react-router-dom";
import { useRouter } from "../covid19/router/router";

const Covid19=()=>{
   const router=useRouter;
    return(
        <>
     <>
        <div className="HeaderLink">
          <ul className="LinkList">
            <li className="LinkItem">
              <NavLink  
              className ='AppLink'
                to="/home" 
                activeStyle={{
                  color: "red",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
                style={{
                  marginRight: "16px",
                  color: "green",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
              >
                {" "}
                HomePage
              </NavLink>
            </li>
            <li className="LinkItem">
              <NavLink      className ='AppLink'
                to="/searh_page"
                activeStyle={{
                  color: "red",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
                style={{
                  color: "green",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
              >
                SearchInfo
              </NavLink>
            </li>
            <li className="LinkItem">
              <NavLink      className ='AppLink'
                to="/topFive/"
                activeStyle={{
                  color: "red",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
                style={{
                  color: "green",
                  textDecoration: "none",
                  fontWeight: "500"
                }}
              >
                Top 5 countries
              </NavLink>
            </li>
          </ul>
          {  router()}
        </div>
   
    </>

       
        </>
        
     ) 
  
  }

export default Covid19;
